import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Navbar from '../../components/navbar/NavbarFreelancer';

const DashboardFreelancer = () => {
  const [jobs, setJobs] = useState([]);

  useEffect(() => {
    const fetchJobs = async () => {
      try {
        const response = await axios.get("http://localhost:8001/jobs/getjobs", {
          withCredentials: true
        });

        const jobsData = response.data;

        if (Array.isArray(jobsData.jobs)) {
          setJobs(jobsData.jobs);
        } else {
          console.error('Invalid data received from the API:', jobsData);
        }
      } catch (error) {
        console.error("Error fetching jobs:", error);
      }
    };

    fetchJobs();
  }, []);

  return (
    <>
    <NavbarFreelancer />
    <div>
      {jobs.map((job, index) => (
        <div key={index}>
          <h3>{job.title}</h3>
          <p>Available Positions: {job.positionsAvailable}</p>
          <p>Skills Required: {job.skills.join(', ')}</p>
          <p>Job Type: {job.jobType}</p>
          <p>Duration: {job.duration}</p>
          <p>Salary: {job.salary}</p>
        </div>
      ))}
    </div>
    </>
    
  );
};

export default DashboardFreelancer;
